"use strict";(self.webpackChunkmy_app=self.webpackChunkmy_app||[]).push([[723],{723:e=>{e.exports=JSON.parse('{"email":"Stuur me een e-mail","cv":"Mijn CV","role":"Softwareontwikkelaar en Noorwegen-enthousiast","description":"Heisann! Ik ben een {age}-jarige Full Stack Softwareontwikkelaar, gespecialisseerd in front-end development. Ik heb een 4-jarige ICT {bachelorLink} gevolgd bij de Hogeschool Utrecht, Nederland. Ik heb {experience}+ jaar werkervaring, voornamelijk met React Javascript & Java Spring.","iam":"Ik ben","availability":"Beschikbaar voor freelance, werk op afstand of verhuizing naar Noorwegen.","norwaypart1":"Noorwegen is voor mij altijd meer geweest dan alleen een plek op de kaart. De adembenemende landschappen, de rijke geschiedenis en de mix van traditie en moderniteit hebben mij gefascineerd. Doordat ik vloeiend Noors spreek, heb ik mijn band met de cultuur verdiept, waardoor elke ervaring\u2014van het verkennen van de fjorden tot het omgaan met de warme gemeenschappen\u2014betekenisvoller is geworden.","norwaypart2":"Ik ben ge\xefnspireerd door de vriendelijkheid en duurzaamheid van Noorwegen en kijk reikhalzend uit naar de dag dat ik dit buitengewone land mijn thuis kan noemen.","norwaypart3":"Ik ben enthousiast om mijn professionele horizon in Noorwegen te verbreden en samen te werken met Noorse bedrijven. Als je mogelijkheden of informatie hebt over verhuizing naar Noorwegen, sta ik meer dan open voor verdere gesprekken!","skillstitle":"Mijn vaardigheden","skillsdescription":"Ontdek de softwarevaardigheden die ik heb om idee\xebn met eenvoud en precisie tot leven te brengen.","frontenddescription":"Ik maak nette, gebruiksvriendelijke websites met React en JavaScript, hou van klantfeedback en pas me gemakkelijk aan verschillende frameworks aan.","backenddescription":" Ik heb uitgebreide ervaring in Java en Spring, bouw applicaties en voer tests uit met JUnit 5 en Mockito, terwijl ik CI/CD-pijplijnen beheer.","toolstitle":"Tools & Platformen","toolsdescription":"Ik ben bedreven in Git voor versiebeheer en GitHub voor projectbeheer en pipelines. Ik gebruik Postman voor API-tests en command-line tools voor Git en implementatie op Azure DevOps.","solutionparagraph":"Ontwikkeling is een kunstvorm op zichzelf\u2014een evenwicht tussen creativiteit en structuur. Ik bouw oplossingen die niet alleen aan de technische eisen voldoen, maar ook een unieke ervaring voor gebruikers bieden. Met aandacht voor detail cre\xeber ik producten die zowel functioneel als esthetisch aantrekkelijk zijn.","worktitle":"Mijn projecten","workdescription":"Bekijk alle producten die ik heb gemaakt voor schoolprojecten, stages, bijprojecten en klussen.","luftandescription":"Luftan is een Zweeds bedrijf gespecialiseerd in geurverspreiders en Scandinavisch ge\xefnspireerde geuren. Het project omvat een volledig e-commerceplatform waar gebruikers door producten kunnen bladeren, items aan hun winkelwagentje kunnen toevoegen en bestellingen kunnen plaatsen. Ik heb de hele site vanaf nul ontwikkeld, waarbij zowel de front-end als de back-end ontwikkeling aan bod kwam.","candidateportaldescription":"Mysolution is een internationaal bedrijf dat een Salesforce-applicatie aanbiedt voor recruitmentbureaus. Tijdens mijn stage voor mijn HBO Bachelor IT Software Development studie moest ik voor een klant van Mysolution een onboarding portal cre\xebren, zodat de medewerkers van genoemde klant hun inloggegevens (personalia, bankrekeninggegevens, privacyverklaringen etc.) konden invullen. Ook moest ik onderzoek doen naar hoe om te gaan met gevoelige gebruikersgegevens volgens de EU-wetgeving (AVG) en gebruikers om toestemming vragen om hun gegevens op te slaan.","huskelistedescription":"HuskeListe is een eenvoudige Noorse taken-app waarmee gebruikers taken aan hun lijsten kunnen toevoegen, afstrepen en verwijderen, zodat ze georganiseerd blijven.","smartfinancedescription":"SmartFinance is een webapplicatie voor studenten Bedrijfskunde van Hogeschool Utrecht. Het helpt hen bij het oefenen met het maken van jaarrekeningen en geeft directe feedback ter voorbereiding op toetsen en huiswerk.","kpndescription":"KPN Reisbewegingen is een site waar KPN-medewerkers hun reisgegevens kunnen loggen, die vervolgens worden samengevoegd in een Excel-rapport. Managers kunnen afdelingsstatistieken bekijken en een scorebord stimuleert het verminderen van de CO2-uitstoot.","seeproject":"Bekijk project"}')}}]);